import React from 'react';
import { NavLink, Outlet } from 'react-router-dom';

const navLinkStyles = ({ isActive }) => ({
  textDecoration: isActive ? 'underline' : 'none',
  fontWeight: isActive ? '600' : '400',
  color: '#333',
  marginRight: '16px',
  transition: 'color 0.2s ease-in-out',
});

export default function AccountLayout() {
  return (
    <section style={{ maxWidth: '800px', margin: '0 auto', padding: '24px' }}>
      <header>
        <h1 style={{ marginBottom: '16px', fontSize: '2rem', color: '#111' }}>Account</h1>
        <nav style={{ marginBottom: '24px' }}>
          <NavLink to="profile" style={navLinkStyles}>
            Profile
          </NavLink>
          <NavLink to="settings" style={navLinkStyles}>
            Settings
          </NavLink>
        </nav>
      </header>

      <main style={{ border: '1px solid #e0e0e0', borderRadius: '8px', padding: '16px', backgroundColor: '#fafafa' }}>
        <Outlet />
      </main>
    </section>
  );
}
